import React from "react";

import classes from "./Card.module.css";
import logo from "../../../photos/logo.png";

const Card = (props) => {
  return (
    <div className={`${classes.card} ${props.className}`}>
      <img
        src={logo}
        className="logo"
        alt="logo.png"
        style="width: 70%; height: 70%;"
      />
      {props.children}
    </div>
  );
};

export default Card;
